import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Users, Settings } from 'lucide-react';
import ContactList from './components/ContactList';
import Dashboard from './components/Dashboard';
import ExcelImport from './components/ExcelImport';
import FollowUps from './components/FollowUps';

export default function App() {
  const [refreshTrigger, setRefreshTrigger] = useState(0);
  const [pendingFollowups, setPendingFollowups] = useState(0);
  const [showFollowupModal, setShowFollowupModal] = useState(false);

  const handleRefresh = () => {
    setRefreshTrigger(prev => prev + 1);
  };

  const handleFollowupsUpdate = (count) => {
    setPendingFollowups(count);
  };

  const handleNotificationClick = () => {
    setShowFollowupModal(true);
  };

  const handleCloseModal = () => {
    setShowFollowupModal(false);
  };

  return (
    <div className="min-h-screen pb-20 bg-gradient-to-br from-blue-50 via-indigo-50 to-purple-50">
      {/* Header */}
      <motion.header
        initial={{ y: -100, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        className="bg-white/90 backdrop-blur-md border-b border-gray-200 sticky top-0 z-40 shadow-sm"
      >
        <div className="w-full px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center gap-3">
              <div className="bg-gradient-to-br from-blue-500 to-indigo-500 p-2 rounded-xl">
                <Users className="w-6 h-6 text-white" />
              </div>
              <div>
                <h1 className="text-xl font-bold text-gray-900">Referral System</h1>
                <p className="text-xs text-gray-500">Track Contacts. Capture Opportunities.</p>
              </div>
            </div>

            <div className="flex items-center gap-3">
              <button className="p-2 hover:bg-gray-100 rounded-lg transition-colors">
                <Settings className="w-5 h-5 text-gray-600" />
              </button>
              <div className="flex items-center gap-2 px-2 py-1 hover:bg-gray-100 rounded-lg cursor-pointer transition-colors">
                <div className="text-right hidden sm:block">
                  <p className="text-xs font-medium text-gray-900">User</p>
                  <p className="text-xs text-gray-500">Recruiter</p>
                </div>
                <div className="w-10 h-10 bg-gradient-to-br from-blue-500 to-indigo-500 rounded-full flex items-center justify-center text-white font-bold shadow-md">
                  U
                </div>
              </div>
            </div>
          </div>
        </div>
      </motion.header>

      {/* Main Content */}
      <main className="w-full px-6 py-8">
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          {/* Left Column - Dashboard & Follow-ups */}
          <div className="lg:col-span-1 space-y-6">
            <Dashboard refreshTrigger={refreshTrigger} />
            <FollowUps 
              refreshTrigger={refreshTrigger} 
              onDataChange={handleRefresh}
              onFollowupsUpdate={handleFollowupsUpdate}
              showModal={showFollowupModal}
              onCloseModal={handleCloseModal}
            />
          </div>

          {/* Right Column - Contact List */}
          <div className="lg:col-span-2">
            <ContactList
              refreshTrigger={refreshTrigger}
              onDataChange={handleRefresh}
              notificationCount={pendingFollowups}
              onNotificationClick={handleNotificationClick}
            />
          </div>
        </div>
      </main>

      {/* Excel Import FAB */}
      <ExcelImport onComplete={handleRefresh} />

      {/* Footer */}
      <motion.footer
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.5 }}
        className="fixed bottom-0 left-0 right-0 bg-white/95 backdrop-blur-md border-t border-purple-100 py-3 z-30 shadow-lg"
      >
        <div className="w-full px-6">
          <p className="text-center text-sm text-purple-600 font-medium">
            Built with <span className="text-pink-500">â™¥</span> for efficient staffing operations
          </p>
        </div>
      </motion.footer>
    </div>
  );
}
